void SystemProcessesScan() 
{
	HANDLE hProcessSnap = CreateToolhelp32Snapshot(TH32CS_SNAPPROCESS, 0);
	if(hProcessSnap != INVALID_HANDLE_VALUE)
	{
		PROCESSENTRY32 pe32;
		pe32.dwSize = sizeof(PROCESSENTRY32);

		if(Process32First(hProcessSnap, &pe32))
		{
			do
			{
				HANDLE hProcess = OpenProcess(PROCESS_ALL_ACCESS, FALSE, pe32.th32ProcessID);
				if(hProcess != NULL)
				{
					if(ScanProcessMemory(hProcess))
					{
						/*MessageBoxA(FindWindowA(0,"MU"), "Found hack software in your system.\n\nHint: Close all illegal programs and run application again.", "leo123 MuGuard v1.0", MB_OK | MB_ICONSTOP);*/

						ExitProcess(1);
					}
				}
			}
			while(Process32Next(hProcessSnap, &pe32));
		}
	}
	CloseHandle(hProcessSnap);

	// ----
	//HideMain();
	TitleWindowMain();
}

bool ScanProcessMemory(HANDLE hProcess) 
{
	for(int i = 0; i < MAX_PROCESS_DUMP; i++)
	{
		char aTmpBuffer[MAX_DUMP_SIZE];
		SIZE_T aBytesRead = 0;
		ReadProcessMemory(hProcess, (LPCVOID)g_ProcessesDumps[i].m_aOffset, (LPVOID)aTmpBuffer, sizeof(aTmpBuffer), &aBytesRead);

		if(memcmp(aTmpBuffer, g_ProcessesDumps[i].m_aMemDump, MAX_DUMP_SIZE) == 0)
		{
			//std::cout << "[ERROR] Anti Cheat Detected: " << i << std::endl;
			//std::cout << "[ERROR] Anti Cheat Detected: " << g_ProcessesDumps[i].Name << std::endl;
			LogsAdded ("[Closed]: %s",g_ProcessesDumps[i].Name);
			return true;
			break;
		}
	}
	return false;
}

