void CheckFilesDir(bool TypeStart)
{
	DIR * dir;
	struct dirent *entry;

	dir = opendir("");
	if (!dir) 
	{
		if(TypeStart==0)
		{
			MessageBoxA(NULL,"Client Hacked !","Check EvilTwin",MB_OK);
			ExitProcess(0);
		}
		else
		{
			ExitProcess(0);
		}
	};
	int i = 0;
	while ( (entry = readdir(dir)) != NULL)
	{
		if(!strcmp(entry->d_name,".") || !strcmp(entry->d_name,".."))
			continue;
		if(!LoadFilesBase(entry->d_name))
		{
			if(TypeStart==0)
			{
				MessageBoxA(NULL,"Client Hacked !","Check EvilTwin",MB_OK);
				ExitProcess(0);
			}
			else
			{
				ExitProcess(0);
			}
		}
		i++;
	};
	closedir(dir);
}


